Defendant Giovannis G Rodriguez in court with attorney Danielle L. Shelton.  Defendant Giovannis G Rodriguez in custody.  James W. Frisch appeared for the State of Wisconsin.  Plea hearing proceeded.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms.    Court further advised defendant of voting ineligibility.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by: Mr. Julio R.  The Court imposed the following sentence:
Defendant's TOTAL LENGTH OF SENTENCE shall be 2 years  consecutive to 15CF623.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for one (1) year with credit for 5 days time served.  Defendant shall serve one (1) year on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.  The Court STAYED said sentence and placed defendant on two years probation, concurrent to 15CF623.
 * DNA sample ordered in 15CF623.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - No contact with Eduardo B. or Sebastian H.;
 - Obtain high school diploma, HSED or GED;
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - No contact with juvenile co-actors D.V.W. (2/16/98); D.G.A. (10/20/98); or R.A.S. (9/22/98);
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Parenting classes/counseling;
 - Pay restitution to Eduardo B. in the amount of $500.00; then pay $1,431.43 to the City of Milwaukee; then $6,723.36 to Progressive Insurance Company; then pay all applicable costs, surcharges and disbursements.  Should defendant get revoked, Court ordered monies taken by the Department of Corrections from up to 25% of prison funds.  Balance would then be paid while on Extended Supervision.    Failure to pay amounts in full would result in a civil judgment entered against defendant.

